import React, { Component } from 'react';
import { Grid, Cell } from 'react-mdl';
import Typist from 'react-typist';

class Landing extends Component {
    render() {
        return(
            <div className="landing-grid" style = {{width: '100%', margin: 'auto'}}>
                <Grid classNme="landing-grid">
                    <Cell col={12}>
                        <img
                        src="https://cdn3.iconfinder.com/data/icons/gundam-colored/48/Cartoons__Anime_Gundam_Artboard_28-512.png"
                        alt="avatar"
                        className="avatar-img"
                        />
                        <Typist>
                            <div className="banner-text">
                                <h1>Kyle Gloria</h1>
                                <hr/>
                                <p> Recent Computer Science Graduate</p>
                                <p>C | Java | Python | HTML | CSS</p>
                            </div>
                        </Typist>
                    </Cell>
                </Grid>
            </div>
        )
    }
}

export default Landing;
